import { Routes, Route } from 'react-router-dom';

import ContextProvider from '../../utils/context/context';

import Dashboard from '../Dashboard/Dashboard';

import useFetch from '../../utils/hooks/hook';

import './Home.css';

const Home = () => {
	// const userId = 12;
	const { data, loading, error } = useFetch('http://localhost:8080/user/:thing');
	console.log(
		'data : ',
		data,
		'\n=====================',
		'\nloading : ',
		loading,
		'\n=====================',
		'\nerror : ',
		error
	);

	return (
		<ContextProvider>
			<div className="user__12">
				<Routes>
					<Route path="/" element={<Dashboard />} />
				</Routes>
			</div>
			<div className="user__18">
				<Routes>
					<Route path="/" element={<Dashboard />} />
				</Routes>
			</div>
		</ContextProvider>
	);
};

export default Home;
